import React, { useEffect, useState } from "react";
import axios from "axios";

const EmployeeList = () => {
    const [employees, setEmployees] = useState([]); // Ensure employees state is defined

    useEffect(() => {
        axios.get("http://localhost:8080/employees") // Ensure Spring Boot is running
            .then(response => setEmployees(response.data))
            .catch(error => console.error("Error fetching employees:", error));
    }, []);

    return (
        <div>
            <h2>Employee List</h2>
            {employees.length > 0 ? ( // Ensure employees is properly checked
                <ul>
                    {employees.map(emp => (
                        <li key={emp.employeeId}>{emp.employeeName}</li>
                    ))}
                </ul>
            ) : (
                <p>No employees found.</p>
            )}
        </div>
    );
};

export default EmployeeList;
